%[text] # **Principal Component Analysis**
%[text] In this script we discuss the theory and motivation for principal component analysis (PCA), and walk through the steps involved when applying PCA to a data set.
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] ## Context and motivation
%[text] ### Applications
%[text] Applications of PCA include:
%[text] - Dimensionality reduction
%[text] - Understanding how features are related
%[text] - Identifying groups of similar features (clustering)
%[text] - Finding outliers \
%[text] ### When can PCA be used?
%[text] PCA can be used whenever we have:
%[text] - a collection of continuous numeric variables, or
%[text] - a correlation or covariance matrix corresponding to a set of variables. \
%[text] ### What is PCA?
%[text] PCA is a matrix transformation designed to decorrelate a set of variables, represented in a matrix $X$. The technique involves post-multiplying $X$ by an orthogonal matrix, $V$. This results in a set of transformed variables $S$ with the property that the new correlation matrix is diagonal. The transformation matrix is chosen such that the cumulative variance of the new variables is maximized.
%[text] - $X$ - a numeric matrix of size $n\\times p$, where $n$ is the number of observations (rows) and $p$ is the number of variables (columns)
%[text] - $V$ - an orthogonal matrix (i.e., $VV^T=V^TV=I\_{p\\times p}$) of size $p\\times p$
%[text] - $S$ - a numeric matrix of size $n\\times p$, obtained by $S=XV$ \
%[text] ### When should PCA not be used?
%[text] PCA is based on linear correlation, so cannot be relied upon to detect nonlinear relationships in data sets.
%[text] ### Example data
%[text] In this script we work with a processed dataset from the National Health and Nutrition Examination Survey ([NHANES](https://wwwn.cdc.gov/nchs/nhanes/)).
%[text] The dataset comprises a set of continuous and categorical variables recording basic body measurements for a collection of individuals.
%[text] Each row of the table holds the data for one individual, and each column of the table is a feature or variable.
load( "HealthData.mat" )
disp( head( H ) ) %[output:29e6d84b]
%[text] ### Motivating example
%[text] Suppose we have a linear regression model:
%[text] $\\text{Weight} = \\beta\_0 + \\beta\_1\\text{Height} + \\beta\_2\\text{TricepsSkinfold}$
load( "HealthData.mat" )
modelVars = H(:, ["Height", "TricepsSkinfold", "Weight"]);
model = fitlm( modelVars, "linear" );
disp( model ) %[output:2ba57d8b]
%[text] Evaluate the model over a grid of $(\\text{Height}, \\text{TricepsSkinfold})$ points.
[mn, mx] = bounds( H.Height );
fineHeight = linspace( mn, mx );
[mn, mx] = bounds( H.TricepsSkinfold );
fineTriceps = linspace( mn, mx );
[HeightGrid, TricepsGrid] = meshgrid( fineHeight, fineTriceps );
WeightGrid = predict( model, [HeightGrid(:), TricepsGrid(:)] );
WeightGrid = reshape( WeightGrid, size( HeightGrid ) );
%[text] Visualize the data and fitted model.
figure %[output:851f9bb1]
scatter3( H.Height, H.TricepsSkinfold, H.Weight, [], H.Weight, "." ) %[output:851f9bb1]
hold on %[output:851f9bb1]
surf( HeightGrid, TricepsGrid, WeightGrid, "FaceAlpha", 0.5 ) %[output:851f9bb1]
shading interp %[output:851f9bb1]
xlabel( "Height (cm)" ) %[output:851f9bb1]
ylabel( "Triceps Skinfold (cm)" ) %[output:851f9bb1]
zlabel( "Weight (kg)" ) %[output:851f9bb1]
title( "Weight vs. Height and Triceps Skinfold" ) %[output:851f9bb1]
colorbar %[output:851f9bb1]
%[text] How do we interpret this model? Since the model is determined completely by its coefficients, it is natural to use the values of $\\beta\_0, \\beta\_1$, and $\\beta\_2$ to understand how the model represents the data. In particular:
%[text] - $\\beta\_1$ represents the change in weight (kg) per unit change in height (cm),
%[text] - $\\beta\_2$ represents the change in weight (kg) per unit change in triceps skinfold (cm). \
%[text] If the height changes significantly, we would expect the triceps skinfold to change significantly because they are significantly linearly correlated.
figure %[output:8ef8609e]
ax = axes; %[output:8ef8609e]
scatter( H.Height, H.TricepsSkinfold, "." ) %[output:8ef8609e]
bestFitLine = lsline(); %[output:8ef8609e]
bestFitLine.LineWidth = 2; %[output:8ef8609e]
bestFitLine.Color = ax.ColorOrder(2, :); %[output:8ef8609e]
xlabel( "Height (cm)" ) %[output:8ef8609e]
ylabel( "Triceps Skinfold (cm)" ) %[output:8ef8609e]
title( "Triceps Skinfold vs. Height" ) %[output:8ef8609e]
grid on %[output:8ef8609e]
[rho, corrPValue] = corr( H.Height, H.TricepsSkinfold, "Rows", "pairwise" );
legend( "Observed data", "Correlation = " + rho ) %[output:8ef8609e]
%%
%[text] ## Mean and variance
%[text] PCA is based upon some core statistical concepts, primarily the covariance or correlation matrix corresponding to a collection of features. Let's first define the mean and variance.
%[text] ### Mean
%[text] For a random variable $X$, the mean (or expected value) of $X$ is $\\mathbb{E}(X)=\\int\_\\mathbb{R}xf(x)dx$, where $f$ is the probability density function of $X$. The mean of $X$ has the same units of measurement as $X$.
%[text] ### Examples
%[text] If $X$ represents a coin toss, then $\\mathbb{E}(X)=1/2$. If $X$ is uniformly distributed on the interval $\[0, 1\]$, then $\\mathbb{E}(X)=1/2$.
%[text] ### Variance
%[text] For a random variable $X$, the variance is the average squared distance to the mean:
%[text] $\\text{var}(X)=\\mathbb{E}((X-\\mathbb{E}(X))^2)$
%[text] This is also equivalent to $\\text{var}(X)=\\mathbb{E}(X^2)-\\mathbb{E}(X)^2$.
%[text] The units of variance are equal to the squared units of measurement of $X$. For this reason, the standard deviation is often used instead of the variance when reporting the spread of a data set:
%[text] $\\text{std}(X)=\\sqrt{\\text{var(X)}$.
%[text] ### Examples
%[text] If $X$ represents a coin toss, then $\\text{var}(X)=1/4$. If $X\\sim \\text{U}(0, 1)$, then $\\text{var}(X)=1/12$.
%%
%[text] ## Covariance and correlation
%[text] ### Covariance
%[text] For two random variables $X$ and $Y$, the covariance is $\\text{cov}(X, Y)=\\mathbb{E}((X-\\mathbb{E}(X))(Y-\\mathbb{E}(Y))$, which is also equivalent to $\\text{cov}(X, Y)=\\mathbb{E}(XY)-\\mathbb{E}(X)\\mathbb{E}(Y)$.
%[text] Note that:
%[text] - Covariance can be interpreted as a measure of the dependence between $X$ and $Y$
%[text] - If $X$ and $Y$ are independent, then $\\text{cov}(X, Y)=0$, so computing $\\text{cov}(X, Y)$ is only meaningful when $X$ and $Y$ are dependent
%[text] - The converse is false unless $X,Y$ are also jointly normally distributed
%[text] - The units of measurement of covariance are given by the product of the units of $X$ and $Y$ \
%[text] If $X=\[\\mathbf{x}\_1, \\dots, \\mathbf{x}\_p\]$ is a matrix containing data variables $\\mathbf{x}\_1, \\dots, \\mathbf{x}\_p$, then $\\text{cov}(X)$ is the $p\\times p$-matrix with entries $\\text{cov}(\\mathbf{x}\_i, \\mathbf{x}\_j)$.
%[text] ### Examples
%[text] If $X$ is a coin toss and $Y$ is the other side of the coin, then $\\text{cov}(X, Y)=-1/4$.
%[text] If a stick of length 1 is broken randomly into two pieces of length $X$ and $Y$, then $\\text{cov}(X, Y)=-1/12$.
%[text] ### Correlation
%[text] It's difficult to compare covariance between different pairs of variables. This is partly due to the arbitrary scale that the variables may be measured on, and partly due to different units of measurement. For example, how could we compare -100 $\\text{kg}\\cdot\\text{m}$ with 5e4 $\\text{J}\\cdot \\text{V}$?
%[text] If $X$ and $Y$ have finite variance, then $|\\text{cov}(X, Y)| \\leq \\text{std}(X)\\text{std}(Y)$. (This follows from the Cauchy-Schwarz inequality.) This bound enables the covariance to be normalized to lie between $-1$ and $+1$:
%[text] $-1\\leq \\frac{\\text{cov}(X, Y)}{\\text{std}(X)\\text{std}(Y)}\\leq +1$.
%[text] For two random variables $X$ and $Y$ with finite nonzero variance, the correlation is:
%[text] $\\rho(X, Y)=\\frac{\\text{cov}(X, Y)}{\\text{std}(X)\\text{std(Y)}}=\\frac{\\mathbb{E}(XY)-\\mathbb{E}(X)\\mathbb{E}(Y)}{\\text{std}(X)\\text{std}(Y)}}$, i.e., the correlation is the normalized covariance.
%[text] If $X=\[\\mathbf{x}\_1, \\dots, \\mathbf{x}\_p\]$ is a matrix containing data variables $\\mathbf{x}\_1, \\dots, \\mathbf{x}\_p$, then $\\rho(X)$ is the $p\\times p$-matrix with entries $\\rho(\\mathbf{x}\_i, \\mathbf{x}\_j)$.
%[text] Note that if $X$ is an $n\\times p$ standardized data matrix (i.e., each column has mean 0 and standard deviation 1), then $\\text{cov}(X)=\\rho(X)$, with entries given by: 
%[text] $\\mathbb{E}(\\mathbf{x}\_i\\mathbf{x}\_j)=\\frac{1}{n}\\sum\_{k=1}^nx\_{k, i}x\_{k,j}=\\frac{1}{n}(X^TX)\_{i,j}$.
%[text] In this case, $\\rho(X)=\\frac{1}{n}X^TX$.
%[text] ### Example
%[text] Extract the continuous variables.
requiredVars = 1:13;
bodyVars = H{:, requiredVars};
bodyVarNames = H(:, requiredVars).Properties.VariableNames;
%[text] The variables are recorded using different units of measurement with large differences in scale, so it's good practice to standardize them before applying any machine learning technique.
figure %[output:5f85c71f]
boxchart( bodyVars ) %[output:5f85c71f]
xticklabels(bodyVarNames) %[output:5f85c71f]
title("Continuous Body Variables") %[output:5f85c71f]
grid on %[output:5f85c71f]
%[text] The $z$-score transformation for a variable $X$ is $Z=\\frac{X-\\mathbb{E}(X)}{\\text{std}(X)}$. This ensures that $\\mathbb{E}(Z)=0$ and $\\text{std}(Z)=\\text{var}(Z)=1$.
bodyVarsZScore = normalize( bodyVars, "zscore" );

figure %[output:73233199]
boxchart( bodyVarsZScore ) %[output:73233199]
xticklabels( bodyVarNames ) %[output:73233199]
title( "Continuous Body Variables" ) %[output:73233199]
grid on %[output:73233199]
%[text] Visualize the correlation matrix.
rho = corr( bodyVarsZScore, "Rows", "pairwise" );

figure %[output:58a985c4]
heatmap( bodyVarNames, bodyVarNames, rho, "Colormap", cool() ) %[output:58a985c4]
title( "Body Measurements: Correlation" ) %[output:58a985c4]
%%
%[text] ## Eigenvalues and eigenvectors
%[text] ### Interpreting eigenvalues and eigenvectors
%[text] If $A\\mathbf{v}=\\lambda\\mathbf{v}$, then $\\mathbf{v}$ represents the direction vector of an invariant line under the transformation defined by $A$, and $\\lambda$ is the scale factor.
%[text] ### Example
%[text] If $A=\\left\[\\begin{array}{cc}2 & 0\\\\0&3\\end{array}\\right\]$, then the eigenvalues of $A$ are 2 and 3, with corresponding eigenvectors $\[1, 0\]^T$ and $\[0, 1\]^T$. The unit square is mapped to the rectangle with coordinates $(2, 0), (2, 3), (0, 3)$ and $(0, 0)$. The volume factor is $2\\times 3=6$.
%[text] ### Linear independence
%[text] If $A$ has eigenvectors $\\mathbf{v}\_1, \\dots, \\mathbf{v}\_p$ corresponding to eigenvalues $\\lambda\_1, \\dots, \\lambda\_p$, write $V=\[\\mathbf{v}\_1, \\dots, \\mathbf{v}\_p\]$. Then:
%[text] $AV=A\[\\mathbf{v}\_1, \\dots, \\mathbf{v}\_p\]=\[A\\mathbf{v}\_1, \\dots, A\\mathbf{v}\_p\]=\[\\lambda\_1\\mathbf{v}\_1, \\dots, \\lambda\\mathbf{v}\_p\]=V\\Lambda$, where $\\Lambda$ is the diagonal matrix containing the eigenvalues of $A$.
%[text] If the eigenvectors are linearly independent, then $V^{-1}$ exists and $V^{-1}AV=\\Lambda$. $A$ is said to be diagonalizable and this means that up to a change of basis, $A$ is equivalent to a diagonal matrix.
%%
%[text] ## **Diagonalization of real symmetric matrices**
%[text] ### **The spectral theorem**
%[text] If $A$ is real and $A=A^T$ (or complex and $\\overline{A}^T=A$) then all eigenvalues of $A$ are real and $A$ is diagonalizable. Further, all eigenvectors of $A$ are orthogonal, so the matrix $V$ can be chosen to be orthogonal: $V^T=V^{-1}$. We have $V^TAV=\\Lambda$.
%[text] ### Application to covariance/correlation matrices
%[text] Any correlation matrix is symmetric, so the spectral theorem applies and we can diagonalize the correlation matrix via an orthogonal matrix. Correlation matrices are also positive definite, i.e., $\\mathbf{v}^T\\rho(X)\\mathbf{v}\\geq 0$ for all real vectors $\\mathbf{v}$, which implies that their eigenvalues are all nonnegative.
%[text] ### Putting everything together
%[text] We saw above that for our standardized data matrix $X$, $\\rho(X)=\\frac{1}{n}X^TX$. Applying the spectral theorem we obtain:
%[text] $V^T\\rho(X)V=\\frac{1}{n}V^TX^TXV=\\frac{1}{n}(XV)^TXV=\\text{cov}(XV)=\\Lambda$.
%[text] The columns of the matrix $XV$ are therefore uncorrelated. Also, we can choose the eigenvalues in decreasing order $\\lambda\_1\\geq \\cdots\\geq \\lambda\_p\\geq 0$, so the columns are ordered by their information (variance) content.
%%
%[text] ## Applying PCA: a geometric interpretation
%[text] In this section, we'll work through an example of applying PCA in two dimensions. This should help to provide a geometric interpretation of the algorithm.
%[text] Create a scatter plot of height and weight.
figure %[output:569ac001]
scatter( H.Height, H.Weight, "." ) %[output:569ac001]
xlabel( "Height (cm)" ) %[output:569ac001]
ylabel( "Weight (kg)" ) %[output:569ac001]
title( "Weight vs. height" ) %[output:569ac001]
grid on %[output:569ac001]
%[text] Plot the centroid (mean $x$ and $y$ values) of the data cloud.
c = mean( H{:, ["Height", "Weight"]}, "omitmissing" );
hold on %[output:569ac001]
plot( c(1), c(2), ".", "MarkerSize", 20 ) %[output:569ac001]
legend( "Data", "Centroid: (" + num2str( c(1), "%.2f" ) + "cm, " + num2str( c(2), "%.2f" ) + "kg)", "Location", "northwest" ) %[output:569ac001]
axis equal %[output:569ac001]
%%
%[text] ## Translate the data so that the centroid lies at the origin.
%[text] We subtract the mean value of each variable. This creates new data centered at the origin.
centeredHeight = H.Height - c(1);
centeredWeight = H.Weight - c(2);
%[text] Recreate the scatter graph.
figure %[output:5ba20a40]
scatter( centeredHeight, centeredWeight, "." ) %[output:5ba20a40]
xlabel( "Mean-centered height (cm)" ) %[output:5ba20a40]
ylabel( "Mean-centered weight (kg)" ) %[output:5ba20a40]
title( "Weight vs. height" ) %[output:5ba20a40]
grid on %[output:5ba20a40]
%[text] Plot the new centroid.
c = mean( [centeredHeight, centeredWeight], "omitmissing" );
hold on %[output:5ba20a40]
plot( c(1), c(2), ".", "MarkerSize", 20 ) %[output:5ba20a40]
legend( "Data", "Centroid: (0, 0)", "Location", "northwest" ) %[output:5ba20a40]
axis equal %[output:5ba20a40]
ax = gca();
ax.XAxisLocation = "origin"; %[output:5ba20a40]
ax.YAxisLocation = "origin"; %[output:5ba20a40]
%%
%[text] ## Rescale the data so that each dimension has standard deviation one.
%[text] We divide the centered data by the standard deviation of each variable. This creates new data with standard deviation (and variance) one in each dimension.
zscoredHeight = centeredHeight / std( H.Height, "omitmissing" );
zscoredWeight = centeredWeight / std( H.Weight, "omitmissing" );
%[text] Recreate the scatter graph.
figure %[output:51f32b53]
scatter( zscoredHeight, zscoredWeight, "." ) %[output:51f32b53]
xlabel( "z-scored height" ) %[output:51f32b53]
ylabel( "z-scored weight" ) %[output:51f32b53]
title( "Z-scored weight vs. z-scored height" ) %[output:51f32b53]
grid on %[output:51f32b53]
hold on %[output:51f32b53]
plot( c(1), c(2), ".", "MarkerSize", 20 ) %[output:51f32b53]
legend( "Data", "Centroid: (0, 0)", "Location", "northwest" ) %[output:51f32b53]
axis equal %[output:51f32b53]
ax = gca();
ax.XAxisLocation = "origin"; %[output:51f32b53]
ax.YAxisLocation = "origin"; %[output:51f32b53]
%%
%[text] ## Compute the principal components.
%[text] Note that rows containing missing values are removed by default.
[V, S] = pca( [zscoredHeight, zscoredWeight] );
%[text] Extract column vectors corresponding to the two principal component coefficients.
pc1 = V(:, 1);
pc2 = V(:, 2);
%[text] Visualize the first principal component. First, recreate the scatter graph and centroid.
figure %[output:14449a45]
scatter( zscoredHeight, zscoredWeight, "." ) %[output:14449a45]
xlabel( "z-scored height" ) %[output:14449a45]
ylabel( "z-scored weight" ) %[output:14449a45]
title( "Z-scored weight vs. z-scored height" ) %[output:14449a45]
grid on %[output:14449a45]
hold on %[output:14449a45]
plot( c(1), c(2), ".", "MarkerSize", 20 ) %[output:14449a45]
%[text] Next, format the equation of the first principal component in terms of the variables.
if pc1(2) >= 0
    s = " + " + num2str( pc1(2) );
else
    s = " - " + num2str( -pc1(2) );
end % if
comp1Eqn = num2str( pc1(1) ) + " * Height" + s + " * Weight";
%[text] Add a quiver arrow to represent the principal component vector.
scale = 3;
quiver( c(1), c(2), pc1(1), pc1(2), scale, ... %[output:14449a45]
    "LineWidth", 1.5, "Color", "r", "MaxHeadSize", 1 ) %[output:14449a45]
axis equal %[output:14449a45]
legend( "Data", "Centroid: (0, 0)", ... %[output:14449a45]
    "Principal component 1: " + newline() + comp1Eqn, ... %[output:14449a45]
    "Location", "southoutside" ) %[output:14449a45]
ax = gca();
ax.XAxisLocation = "origin"; %[output:14449a45]
ax.YAxisLocation = "origin"; %[output:14449a45]
%%
%[text] ## Visualize the second principal component.
%[text] Format the equation of the second principal component.
if pc2(2) >= 0
    s = " + " +  num2str( pc2(2) );
else
    s = " - " + num2str( -pc2(2) );
end % if
comp2Eqn = num2str( pc2(1) ) + " * Height " + s + " * Weight";
quiver( c(1), c(2), pc2(1), pc2(2), scale, ... %[output:group:31682819] %[output:376f531a]
    "LineWidth", 1.5, "Color", "r", "MaxHeadSize", 1, ... %[output:376f531a]
    "DisplayName", "Principal component 2: " + newline() + comp2Eqn ) %[output:group:31682819] %[output:376f531a]
%[text] In this example, the coefficient matrix is $V = \\frac{1}{\\sqrt{2}}\\left\[\\begin{array}{cc}1 & -1\\\\1 & 1\\end{array}\\right\]==\\left\[\\begin{array}{cc}\\cos(\\pi/4) & -\\sin(\\pi/4)\\\\\\cos(\\pi/4) & \\sin(\\pi/4)\\end{array}\\right\]$.
%[text] The matrix $V$ represents an anticlockwise rotation of $\\pi/4$ radians (45 degrees) about the positive $x$-axis.
%%
%[text] ## Overlay the ellipse with axes defined by the principal components.
%[text] The equation of an ellipse centered at the origin is $\\left(\\frac{x}{a}\\right)^2+\\left(\\frac{y}{b}\\right)^2=1$, where $a,b\>0$ are constants. We can write the ellipse in parametric coordinates as $x = a\\cos t$, $y = b\\sin t$. The equation defining the principal component analysis is $S=XV$. To reconstruct the data $X$ we therefore obtain $X=SV^T$.
t = linspace( 0, 2 * pi, 500 ).';
x = scale * cos(t);
y = scale * sin(t);
e = [x, y] * V.';
xellipse = e(:, 1);
yellipse = e(:, 2);
plot( xellipse, yellipse, ":", "LineWidth", 2, "DisplayName", "Ellipse with principal component axes" ) %[output:9a736027]
%%
%[text] ## Visualize the transformed data in the new coordinate system.
%[text] Plot the transformed data points (the scores) and the centroid.
figure %[output:1e12045f]
scatter( S(:, 1), S(:, 2), ".", "DisplayName", "Transformed height/weight data" ) %[output:1e12045f]
hold on %[output:1e12045f]
plot( c(1), c(2), ".", "MarkerSize", 20, "DisplayName", "Centroid: (0,0)" ) %[output:1e12045f]
%[text] Annotate the chart and draw the axes to pass through the origin.
ax = gca();
ax.XAxisLocation = "origin"; %[output:1e12045f]
ax.YAxisLocation = "origin"; %[output:1e12045f]
xlabel( "Component 1" ) %[output:1e12045f]
ylabel( "Component 2" ) %[output:1e12045f]
title( "Data points in the transformed coordinates" ) %[output:1e12045f]
grid on %[output:1e12045f]
%[text] Overlay the component vectors.
quiver( c(1), c(2), 1, 0, scale, ... %[output:1e12045f]
    "LineWidth", 2, "Color", "r", "MaxHeadSize", 1, ... %[output:1e12045f]
    "DisplayName", "Principal component 1" ) %[output:1e12045f]
quiver( c(1), c(2), 0, 1, scale, ... %[output:1e12045f]
    "LineWidth", 2, "Color", "r", "MaxHeadSize", 1, ... %[output:1e12045f]
    "DisplayName", "Principal component 2" ) %[output:1e12045f]
axis equal %[output:1e12045f]
%[text] Visualize the ellipse with axes defined by the principal component vectors. 
plot( x, y, ":", "LineWidth", 2, "DisplayName", "Ellipse with principal component axes" ) %[output:1e12045f]
legend( "Location", "southoutside" ) %[output:1e12045f]
%%
%[text] ## Applying PCA
%[text] Now that we've applied PCA in two dimensions and interpreted the results geometrically, let's scale up to the entire data set.
[V, S, Lambda] = pca( bodyVarsZScore );
%[text] Verify that the transformed variables are uncorrelated.
srho = corr( S, "Rows", "pairwise" );

figure %[output:303f5362]
heatmap( srho, "Colormap", turbo() ) %[output:303f5362]
title( "Scores: Correlation" ) %[output:303f5362]
%%
%[text] ## Interpreting the coefficients, scores, and eigenvalues
%[text] ### Coefficients
%[text] The transformation matrix $V$ is often referred to as the coefficient matrix, or loadings matrix. Each column represents a principal component, and each row represents a variable from the original data matrix. The elements of the matrix are weights corresponding to the contribution of each variable to the principal component.
%[text] In other words, $\\text{PC}\_k=\\sum\_{i=1}^pV\_{i, k}\\mathbf{x}\_i$ for each $k\\in\\{1, \\dots, p\\}$, where $X=\[\\mathbf{x}\_1, \\dots, \\mathbf{x}\_p\]$ is the original data matrix.
p = width( bodyVars );

figure %[output:0e886538]
imagesc( 1:p, 1:p, V, [-1, 1] ) %[output:0e886538]
colormap cool %[output:0e886538]
xticks( 1:p ) %[output:0e886538]
xlabel( "Principal component" ) %[output:0e886538]
yticks( 1:p ) %[output:0e886538]
yticklabels( bodyVarNames ) %[output:0e886538]
title( "Coefficients" ) %[output:0e886538]
%[text] Visualize variables which have a high association with each principal component.
highIdx = V > 0.30;
hold on %[output:0e886538]
spy( highIdx, "g.", 12 ) %[output:0e886538]
%[text] We see that:
%[text] - Component 1 represents weight-related variables
%[text] - Component 2 represents height-related variables
%[text] - Component 3 represents age and blood pressure-related variables
%[text] - Component 4 is closely related to pulse
%[text] - Subsequent components don't contribute much more information \
%[text] ### Scores
%[text] The scores are the transformed variables, $S=XV$. These are uncorrelated by construction. The total variance of the scores is equal to the total variance of the original data. (This is because the trace of a matrix is preserved under a similarity transform.) Each score is a linear combination of all the original variables in $X$, with the weights in the linear combination given by the corresponding column of the transformation matrix $V$.
%[text] Visualize the scores using the first three principal components. Show the positions of the original vectors in the new coordinate system.
figure %[output:7c9557fe]
biplot( V(:, 1:3), "Scores", S(:, 1:3), "VarLabels", bodyVarNames ) %[output:7c9557fe]
title( "Scores and Variables" ) %[output:7c9557fe]
%[text] ### Eigenvalues
%[text] The eigenvalues represent the relative proportions of the total variance explained by each principal component.
figure %[output:08e8891a]
plot( Lambda, "o-", "LineWidth", 2 ) %[output:08e8891a]
xticks( 1:p ) %[output:08e8891a]
xlabel( "Principal component" ) %[output:08e8891a]
ylabel( "Eigenvalue" ) %[output:08e8891a]
title( "Eigenvalues from PCA" ) %[output:08e8891a]
grid on %[output:08e8891a]
%[text] Show the same information as a cumulative percentage of the total variance.
figure %[output:25bb20bc]
pareto( Lambda ) %[output:25bb20bc]
xlabel( "Principal component" ) %[output:25bb20bc]
ylabel( "Eigenvalue" ) %[output:25bb20bc]
title( "Pareto Plot for the Health Data PCA" ) %[output:25bb20bc]
grid on %[output:25bb20bc]
%[text] 
%%
%[text] ## Deciding how many components to keep
%[text] ### The elbow method
%[text] In this method, we look for an elbow (a point at which the gradient changes rapidly) in the eigenvalue plot. For this data set, we could choose to keep 4 components.
%[text] ### The white noise method
%[text] With this approach, we take only those principal components which contain more information than what we'd obtain from applying the same algorithm to a data set comprised of white noise. Since we standardized our data and worked from the correlation matrix, this is equivalent to keeping those principal components with a variance above 1.
figure %[output:6243bf4e]
plot( Lambda, "o-", "LineWidth", 2 ) %[output:6243bf4e]
xticks( 1:p ) %[output:6243bf4e]
xlabel( "Principal component" ) %[output:6243bf4e]
ylabel( "Eigenvalue" ) %[output:6243bf4e]
title( "Eigenvalues from PCA" ) %[output:6243bf4e]
grid on %[output:6243bf4e]
yline( 1, "LineWidth", 2, "Label", "White noise threshold" ) %[output:6243bf4e]
%[text] ### The broken stick method
%[text] If a stick of length 1 is broken randomly into $p$ segments of lengths $L\_1\\geq L\_2\\geq \\cdots \\geq L\_p$, then
%[text] $\\mathbb{E}(L\_k)=\\frac{1}{p}\\sum\_{i=k}^p\\frac{1}{i}$
%[text] For example, the expected length of the longest segment is $\\mathbb{E}(L\_1)=\\frac{1}{p}\\left(1 + 1/2 + 1/3 + \\dots + 1/p\\right)$, and for the next longest is $\\mathbb{E}(L\_2)=\\frac{1}{p}\\left(1/2 + \\dots + 1/p\\right)$.
%[text] We can choose to keep those principal components $V\_k$ with variance greater than $\\mathbb{E}(L\_k)$. These components account for more variance than what would be expected by chance.
reciprocals = 1 ./ (1:p);
expectedLengths = sum( reciprocals ) - cumsum( [0, reciprocals(1:end-1)] );
hold on %[output:6243bf4e]
plot( expectedLengths, "o-", "LineWidth", 2 ) %[output:6243bf4e]
legend( "Eigenvalues", "White noise threshold", "Broken stick method" ) %[output:6243bf4e]
%[text] With the broken stick method, we would keep three components.
%%
%[text] ## Grouping variables
%[text] Let's look at the positions of the variables within the new coordinate system.
figure %[output:15cb7b0b]
biplot( V(:, 1:3), "VarLabels", bodyVarNames ) %[output:15cb7b0b]
title( "Grouping Variables" ) %[output:15cb7b0b]
%[text] Observations:
%[text] - There are three main groups, or clusters, of variables, corresponding to the principal components we identified above
%[text] - Orthogonal vectors are uncorrelated
%[text] - Parallel vectors are correlated
%[text] - Long vectors are well-represented in the given coordinates
%[text] - Short vectors are not well-represented in the given coordinates (e.g., pulse) \
%%
%[text] ## Selecting representative features
%[text] If our objective is to select features for a model, we may want to work with observed data rather than principal components. This could be for ease of interpretation - it's easier to understand a variable such as height or weight, but principal components cannot be observed directly - they are linear combinations of features and so exist only in an abstract sense. We might also want to select a representative feature from each of the groups of features that we've previously identified.
%[text] We can perform another orthgonal transformation to maximize the alignment between the principal component axes and the original variables.
%[text] 
A = rotatefactors( V );

figure %[output:22af6f2f]
heatmap( 1:p, bodyVarNames, abs(A), "Colormap", cool() ) %[output:22af6f2f]
title( "After Factor Rotation" ) %[output:22af6f2f]
%[text] The disadvantage of this approach is that by selecting original variables instead of principal components, we reintroduce mutual correlation. Unless the selected variables are already uncorrelated, they will not explain as much variance as selecting the same number of principal components.
%%
%[text] ## PCA for image feature extraction
%[text] Since $S=XV$, we have $X=SV^T$. The original data matrix is therefore approximated by $X\\approx S\_nV\_n^T$, where $S\_n$ is the matrix comprising the first $n$ columns of $S$ (and similarly for $V\_n$).
%[text] Select an image file and convert it to a grayscale floating-point matrix.
imageFile = "peppers.png"; %[control:dropdown:8718]{"position":[13,26]}
rgb = imread( imageFile );
gray = im2gray( rgb );
I = double( gray );
%[text] Apply PCA. Do not center the data - this makes the reconstruction simpler. We don't standardize the image data because we expect all elements belong to a fixed grayscale range of integer values.
[IV, IS, ILambda] = pca( I, "Centered", false );
numComponents = 13; %[control:spinner:4c8a]{"position":[17,19]}
%[text] Approximate the grayscale image.
approxI = IS(:, 1:numComponents) * IV(:, 1:numComponents).';
%[text] Show the results.
figure %[output:06c6b560]
imshowpair( gray, approxI, "montage" ) %[output:06c6b560]
title( "Number of components: " + numComponents ) %[output:06c6b560]
%%
%[text] ## Outlier analysis
%[text] Each row of the scores matrix corresponds to an observation in the new coordinate system. We can use the distance to the origin in the new coordinates, weighted by the variance of each principal component, to measure how unusual each data point is. These values are referred to as Hotelling's $t^2$-statistics, and are available as the fourth output from the `pca` function.
%[text] Alternatively, we can compute them directly from the scores and eigenvalues as follows.
t2 = sum( (S ./ Lambda.').^2, 2 );
%[text] The vector $\\Lambda$ containing the eigenvalues is equivalent to a vector containing the variance of each column of the scores.
%[text] We'll learn more about identifying outliers using the $t^2$-statistics in another session.

